import styled from 'styled-components';
import useStats from "../utils/useStats";


const Landing = styled.div`
    box-shadow: -6px -6px 9px #ffffff, 6px 6px 9px rgba(0, 0, 0, 0.2);
    height: 100px;
    margin: 0 2rem 20px 2rem;
    padding: 48px 64px;
  border-radius: 16px;
    background-color: #e3e3e3;
`;

const Title = styled.h1`
  font-size: 2.4em;
  text-align: left;
  color: #fbc531;
`;

export default function Header() {
    return (
        <Landing>
            <Title>Corrona Virus (Covid 19)</Title>
        </Landing>
    );
}
